#
# Structure for table "currency_bank"
#

DROP TABLE IF EXISTS `currency_bank`;
CREATE TABLE `currency_bank` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userid` int(11) DEFAULT '0' COMMENT '用户id',
  `name` varchar(255) DEFAULT NULL COMMENT '备注名称',
  `bank` varchar(255) DEFAULT NULL COMMENT '开户银行  关联银行卡类型的id',
  `bankprov` varchar(255) DEFAULT NULL COMMENT '开户省份',
  `bancity` varchar(255) DEFAULT NULL COMMENT '开户城市',
  `bankaddr` varchar(255) DEFAULT '' COMMENT '银行名字',
  `bankcard` varchar(255) DEFAULT NULL COMMENT '卡号',
  `type` int(11) DEFAULT NULL COMMENT '交易账号类型 1：银行卡号   2：支付宝  3：微信',
  `sort` varchar(255) DEFAULT NULL COMMENT '排序',
  `addtime` int(11) DEFAULT NULL COMMENT '添加时间',
  `endtime` int(255) DEFAULT NULL COMMENT '最后修改时间',
  `status` varchar(255) DEFAULT '1' COMMENT '状态',
  `username` varchar(255) DEFAULT NULL COMMENT '关联的用户名',
  `bankname` varchar(255) DEFAULT NULL COMMENT '开户人的姓名',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='银行卡';

#
# Data for table "currency_bank"
#

/*!40000 ALTER TABLE `currency_bank` DISABLE KEYS */;
