#
# Structure for table "currency_bankreceive"
#

DROP TABLE IF EXISTS `currency_bankreceive`;
CREATE TABLE `currency_bankreceive` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bank` varchar(255) DEFAULT NULL COMMENT '银行',
  `bankcard` varchar(255) DEFAULT NULL COMMENT '银行卡号',
  `status` int(11) DEFAULT '1',
  `addtime` varchar(255) DEFAULT NULL COMMENT '添加时间',
  `endtime` varchar(255) DEFAULT NULL COMMENT '修改时间',
  `sort` int(11) DEFAULT '0' COMMENT '1默认地址',
  `payee` varchar(255) NOT NULL DEFAULT '' COMMENT '收款方',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='人民币收款地址';

