INSERT INTO `currency_document_article` VALUES (1,0,'<h1>\r\n\tOneThink1.0正式版发布&nbsp;\r\n</h1>\r\n<p>\r\n\t<br />\r\n</p>\r\n<p>\r\n\t<strong>OneThink是一个开源的内容管理框架，基于最新的ThinkPHP3.2版本开发，提供更方便、更安全的WEB应用开发体验，采用了全新的架构设计和命名空间机制，融合了模块化、驱动化和插件化的设计理念于一体，开启了国内WEB应用傻瓜式开发的新潮流。&nbsp;</strong> \r\n</p>\r\n<h2>\r\n\t主要特性：\r\n</h2>\r\n<p>\r\n\t1. 基于ThinkPHP最新3.2版本。\r\n</p>\r\n<p>\r\n\t2. 模块化：全新的架构和模块化的开发机制，便于灵活扩展和二次开发。&nbsp;\r\n</p>\r\n<p>\r\n\t3. 文档模型/分类体系：通过和文档模型绑定，以及不同的文档类型，不同分类可以实现差异化的功能，轻松实现诸如资讯、下载、讨论和图片等功能。\r\n</p>\r\n<p>\r\n\t4. 开源免费：OneThink遵循Apache2开源协议,免费提供使用。&nbsp;\r\n</p>\r\n<p>\r\n\t5. 用户行为：支持自定义用户行为，可以对单个用户或者群体用户的行为进行记录及分享，为您的运营决策提供有效参考数据。\r\n</p>\r\n<p>\r\n\t6. 云端部署：通过驱动的方式可以轻松支持平台的部署，让您的网站无缝迁移，内置已经支持SAE和BAE3.0。\r\n</p>\r\n<p>\r\n\t7. 云服务支持：即将启动支持云存储、云安全、云过滤和云统计等服务，更多贴心的服务让您的网站更安心。\r\n</p>\r\n<p>\r\n\t8. 安全稳健：提供稳健的安全策略，包括备份恢复、容错、防止恶意攻击登录，网页防篡改等多项安全管理功能，保证系统安全，可靠、稳定的运行。&nbsp;\r\n</p>\r\n<p>\r\n\t9. 应用仓库：官方应用仓库拥有大量来自第三方插件和应用模块、模板主题，有众多来自开源社区的贡献，让您的网站“One”美无缺。&nbsp;\r\n</p>\r\n<p>\r\n\t<br />\r\n</p>\r\n<p>\r\n\t<strong>&nbsp;OneThink集成了一个完善的后台管理体系和前台模板标签系统，让你轻松管理数据和进行前台网站的标签式开发。&nbsp;</strong> \r\n</p>\r\n<p>\r\n\t<br />\r\n</p>\r\n<h2>\r\n\t后台主要功能：\r\n</h2>\r\n<p>\r\n\t1. 用户Passport系统\r\n</p>\r\n<p>\r\n\t2. 配置管理系统&nbsp;\r\n</p>\r\n<p>\r\n\t3. 权限控制系统\r\n</p>\r\n<p>\r\n\t4. 后台建模系统&nbsp;\r\n</p>\r\n<p>\r\n\t5. 多级分类系统&nbsp;\r\n</p>\r\n<p>\r\n\t6. 用户行为系统&nbsp;\r\n</p>\r\n<p>\r\n\t7. 钩子和插件系统\r\n</p>\r\n<p>\r\n\t8. 系统日志系统&nbsp;\r\n</p>\r\n<p>\r\n\t9. 数据备份和还原\r\n</p>\r\n<p>\r\n\t<br />\r\n</p>\r\n<p>\r\n\t&nbsp;[ 官方下载：&nbsp;<a href=\"http://www.onethink.cn/download.html\" target=\"_blank\">http://www.onethink.cn/download.html</a>&nbsp;&nbsp;开发手册：<a href=\"http://document.onethink.cn/\" target=\"_blank\">http://document.onethink.cn/</a>&nbsp;]&nbsp;\r\n</p>\r\n<p>\r\n\t<br />\r\n</p>\r\n<p>\r\n\t<strong>OneThink开发团队 2013</strong> \r\n</p>','',0),(2,0,'<p style=\"color:#666666;font-family:&quot;background-color:#FFFFFF;\">\r\n\t<span style=\"color:#333333;font-size:16px;\">亲爱的聚币用户：</span>\r\n</p>\r\n<p style=\"color:#666666;font-family:&quot;background-color:#FFFFFF;\">\r\n\t<span style=\"color:#333333;font-size:16px;\">&nbsp; &nbsp; &nbsp; 企鹅币社区自2016年初成立以来平稳健康发展，企鹅币同时也受到广大投资者追捧以及市场的认可，为了满足社区成员对数字资产管理的多样化需求，顺应当今全球繁荣的数字资产市场发展，企鹅币从即日起升级为企鹅链。</span>\r\n</p>\r\n<p style=\"color:#666666;font-family:&quot;background-color:#FFFFFF;\">\r\n\t<span style=\"color:#333333;font-size:16px;\">&nbsp; &nbsp; &nbsp;&nbsp;聚币网将从2017年6月14日晚21时起暂停企鹅币转入、转出，待升级完成（另行通知）后，聚币网用户持有的企鹅币将自动置换成全新的企鹅链。</span>\r\n</p>\r\n<p style=\"color:#666666;font-family:&quot;background-color:#FFFFFF;\">\r\n\t<span style=\"color:#333333;font-size:16px;\">&nbsp; &nbsp; &nbsp; 企鹅链是基于新一代去中心化应用开发平台Asch发行的全球首个数字资产。</span>\r\n</p>\r\n<p style=\"color:#666666;font-family:&quot;background-color:#FFFFFF;\">\r\n\t<span style=\"color:#333333;font-size:16px;\">&nbsp; &nbsp; &nbsp; Asch官方网站：</span><a href=\"https://www.asch.so/\" target=\"_self\"><span>https://www.asch.so</span></a>\r\n</p>','',0),(3,0,'<p style=\"color:#666666;font-family:\" background-color:#ffffff;\"=\"\"> <span style=\"color:#333333;font-size:16px;\">当前新一轮科技革命和产业变革席卷全球，大数据、云计算、物联网、人工智能、区块链等新技术不断涌现，数字经济正深刻地改变着人类的生产和生活方式，作为经济增长新动能的作用日益凸显，伴随而来的数字资产交易行情也到达了空前火爆，作为全国领先的数字资产交易平台，我们再次提醒聚币网所有用户：</span> \r\n\t</p>\r\n<p style=\"color:#666666;font-family:\" background-color:#ffffff;\"=\"\"> <span style=\"color:#333333;font-size:16px;\">&nbsp; &nbsp; &nbsp; 比特币等其他虚拟币不由货币当局发行，不具有法偿性与强制性，具有极高的价格波动风险，强烈建议您请在风险自担的前提下谨慎投资。</span> \r\n</p>\r\n<p style=\"color:#666666;font-family:\" background-color:#ffffff;\"=\"\"> <span style=\"color:#333333;font-size:16px;\">&nbsp; &nbsp; &nbsp; 网络上（包括QQ群、微信群、微博、自媒体等）任何用户或者嘉宾的发言，都有其特定立场而不应构成对您的投资建议，投资决策需要建立在独立思考之上。</span> \r\n\t</p>\r\n<p style=\"color:#666666;font-family:\" background-color:#ffffff;\"=\"\"> <span style=\"color:#333333;font-size:16px;\">&nbsp; &nbsp; &nbsp; 聚币网作为中立的数字资产交易平台提供方，不参与数字资产交易，不承担用户参与数字资产交易的亏损。</span> \r\n</p>\r\n<p style=\"text-align:right;color:#666666;font-family:\" background-color:#ffffff;\"=\"\"> <span style=\"color:#333333;font-size:16px;\">xx网</span> \r\n\t</p>\r\n<p style=\"text-align:right;color:#666666;font-family:\" background-color:#ffffff;\"=\"\"> <span style=\"color:#333333;font-size:16px;\">2017年6月16日</span> \r\n</p>\r\n<div>\r\n\t<br />\r\n</div>','',0);
/*!40000 ALTER TABLE `currency_document_article` ENABLE KEYS */;

#
# Structure for table "currency_document_download"
#

DROP TABLE IF EXISTS `currency_document_download`;
CREATE TABLE `currency_document_download` (
  `id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '文档ID',
  `parse` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '内容解析类型',
  `content` text NOT NULL COMMENT '下载详细描述',
  `template` varchar(100) NOT NULL DEFAULT '' COMMENT '详情页显示模板',
  `file_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '文件ID',
  `download` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '下载次数',
