#
# Structure for table "currency_markethouse"
#

DROP TABLE IF EXISTS `currency_markethouse`;
CREATE TABLE `currency_markethouse` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '市场名称',
  `buyminprice` decimal(10,2) DEFAULT NULL COMMENT '买家最小交易价',
  `buymaxprice` decimal(10,2) DEFAULT NULL COMMENT '买家最大交易价',
  `sellminprice` decimal(10,2) DEFAULT NULL COMMENT '卖家最小交易价',
  `sellmaxprice` decimal(10,2) DEFAULT NULL COMMENT '卖家最大交易价',
  `standardmoney` varchar(255) DEFAULT NULL COMMENT '本位币',
  `status` varchar(255) DEFAULT NULL COMMENT '是否启用 1启用 2禁用',
  `openingquotation` int(11) DEFAULT NULL COMMENT '1开盘，2闭盘',
  `addtime` int(11) DEFAULT NULL COMMENT '添加时间',
  `admin` varchar(255) DEFAULT NULL COMMENT '管理员',
  `closetime` int(11) DEFAULT NULL COMMENT '闭盘时间',
  `opentime` int(11) DEFAULT NULL COMMENT '开盘时间',
  `xnb` varchar(255) DEFAULT NULL COMMENT '该市场有哪些虚拟币',
  `maxallmoney` int(11) DEFAULT '0' COMMENT '单笔交易总额最大额',
  `minallmoney` int(11) DEFAULT NULL COMMENT '单笔交易总额最小额',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=46 DEFAULT CHARSET=utf8 COMMENT='交易市场';

