DROP TABLE IF EXISTS `currency_poundage`;
CREATE TABLE `currency_poundage` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `market` varchar(255) DEFAULT NULL COMMENT '市场',
  `type` varchar(255) DEFAULT NULL COMMENT '类型 1买2卖3转出4提现',
  `money` varchar(255) DEFAULT NULL COMMENT '金额',
  `time` int(11) DEFAULT NULL COMMENT '时间',
  `xnb` varchar(255) DEFAULT NULL COMMENT '币种类型',
  `oderfor` varchar(255) DEFAULT NULL COMMENT '订单号（交易订单，才用json）',
  `userid` int(11) DEFAULT NULL,
  `username` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='手续费';

