INSERT INTO `currency_text` VALUES (12,0,5,'','公司介绍','公司介绍',0,0,'<p style=\"text-indent:2em;\">\r\n\tadmin\r\n</p>\r\n<p>\r\n\t<br />\r\n</p>',1498729414,1510736433,0,1,'admin'),(13,0,5,'','加入我们','联系我们',1,1,'<p style=\"text-indent:2em;\">\r\n\t<strong><span style=\"color:#337FE5;\">软件工程师</span></strong> \r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t<strong>岗位职责：</strong>能与设计师产品经理默契合作，确保产品前端UI和交互方面开发需求，并确保产品在不同平台和设备上兼容。\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t<strong>职位要求：</strong> \r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t1.掌握专业的php/html/css/js方面的知识；\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t2.良好的服务意识、耐心和责任心，工作积极主动;\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t3.能够写出高性能、高可维护性的“优美”的代码4.对现货交易，股票交易有了解者优先。\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t<span style=\"color:#337FE5;\"><strong>市场运营师</strong></span> \r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t<strong>岗位职责：</strong><span> </span> \r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t1.了解市场动态，搜集市场信息，协助上级制订计划\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t2.制订、执行市场推广计划和方案，包括市场活动、广告及公关\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t3.承担市场推广活动的策划和筹备工作\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t4.利用各种网络工具、通过口碑营销的方式推广公司的品牌及项目，如门户网站、QQ群、论坛、博客、微信、微博等\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t5.建立并维护与外部媒体、机关及相关社会机构的良好合作关系\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t6.完成部门领导交办的其它工作任务\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t<strong>职位要求：</strong><span> </span> \r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t1. 专科以上学历；\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t2. 1年以上互联网市场运营经验；\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t3. 认真细致,吃苦耐劳,有创新精神；\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t4. 善于沟通,具备相当的文字表达能力,具备互联网精神；\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t<br />\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n\t<br />\r\n</p>',1498729675,1510736414,0,1,'admin'),(15,0,5,'','用户注册协议','用户注册协议',1,0,'<p class=\"MsoNormal\" align=\"left\">\r\n\t<span> </span> \r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t1.用户点击农畜商品交易中心注册页面的同意注册按钮并完成注册程序、获得农畜商品交易中心账号和密码时，视为用户与农畜商品交易中心已达成《农畜商品交易中心用户协议》(下称“本协议”)，就用户进入农畜商品交易中心使用农畜商品交易中心相应的交易服务达成本协议的全部约定。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t2. 农畜商品交易中心及用户均已认真阅读本《农畜商品交易中心用户协议》中全部条款及农畜商品交易中心发布的法律声明和操作规则的内容，对本协议及前述服务条款、法律声明和操作规则均已知晓、理解并接受，同意将其作为确定双方权利义务的依据。农畜商品交易中心《法律声明》为本协议的必要组成部分，用户接受本协议的同时即视为接受农畜商品交易中心《法律声明》的全部内容。本协议内容包括本协议正文以及农畜商品交易中心已经发布的或将来可能发布的各类规则、声明、说明。所有规则、声明、说明为协议不可分割的一部分，与协议正文具有同等法律效力。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t3. 本协议不涉及农畜商品交易中心用户与其他用户之间因交易而产生的法律关系及法律纠纷。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t一、定义条款\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t1.1.“农畜商品交易中心”：华联全球商贸运营和管理的交易平台，域名为：http://shop.hlqqsm.cn, <span>华联全球商贸</span>通过该网络交易平台为用户提供进行网络交易平台服务。本协议下文中，“农畜商品交易中心”既指网络交易平台（<span>http://shop.hlqqsm.cn</span>），亦指<span>华联全球商贸</span>。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t1.2.“用户”：接受并同意本协议全部条款及农畜商品交易中心不时发布和更新的法律条款和操作规则、通过农畜商品交易中心进行交易的农畜商品交易中心注册会员。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t1.3.“用户注册”：用户注册是指用户登录农畜商品交易中心，并按要求填写相关信息并确认同意履行相关用户协议的过程。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t1.4.“交易”：用户通过农畜商品交易中心进行的交易活动。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t1.5.“充值款”：用户为购买/出售而向农畜商品交易中心平台预充入的余额款项。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t1.6.“手续费”：用户在农畜商品交易中心达成交易而向农畜商品交易中心支付的交易服务费用。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t二、用户注册\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t2.1.注册资格\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t用户承诺：用户具有完全民事权利能力和行为能力，或虽不具有完全民事权利能力和行为能力,但点击同意注册按钮，本网即视为经其法定代理人同意并由其法定代理人代理注册及应用农畜商品交易中心服务。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t2.2.注册目的\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t用户承诺：用户进行用户注册并非出于违反法律法规或破坏农畜商品交易中心交易秩序的目的。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t2.3.注册流程\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t2.3.1.用户同意根据农畜商品交易中心用户注册页面的要求提供有效电子邮箱等信息，设置农畜商品交易中心账号及密码，用户应确保所提供全部信息的真实性、完整性和准确性。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t2.3.2.用户合法、完整并有效提供注册所需信息的，有权获得农畜商品交易中心账号和密码，农畜商品交易中心账号和密码用于用户在农畜商品交易中心进行会员登录。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t2.3.3.用户获得农畜商品交易中心账号及密码时视为用户注册成功，用户同意接收农畜商品交易中心发送的与农畜商品交易中心网站管理、运营相关的电子邮件和/或短消息。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t2.3.4 用户注册成功后进行交易，应当提供本人的真实身份证号码，进行实名认证。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t三、用户服务\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t农畜商品交易中心为用户通过农畜商品交易中心进行交易活动提供网络交易平台服务。农畜商品交易中心不作为买家或是卖家参与买卖行为本身。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t3.1.服务内容\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t3.1.1.用户有权在农畜商品交易中心浏览实时行情及交易信息、有权通过农畜商品交易中心提交交易指令并完成交易。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t3.1.2.用户有权在农畜商品交易中心查看其农畜商品交易中心会员账号下的信息，有权应用农畜商品交易中心提供的功能进行操作。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t3.1.3.用户有权按照农畜商品交易中心发布的活动规则参与农畜商品交易中心组织的网站活动。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t3.1.4.农畜商品交易中心承诺为用户提供的其他服务。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t3.2.服务规则\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t用户承诺遵守下列农畜商品交易中心服务规则：\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t3.2.1.用户应当遵守法律法规、规章、规范性文件及政策要求的规定，保证账户中所有资金和来源的合法性，不得在农畜商品交易中心或利用农畜商品交易中心服务从事非法或其他损害农畜商品交易中心或第三方权益的活动，如发送或接收任何违法、违规、违反公序良俗、侵犯他人权益的信息，发送或接收传销材料或存在其他危害的信息或言论，未经农畜商品交易中心授权使用或伪造农畜商品交易中心电子邮件题头信息等。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t3.2.2.用户应当遵守法律法规应当妥善使用和保管其农畜商品交易中心账号及密码、资金密码、和其注册时绑定的手机号码、以及手机接收的手机验证码的安全。用户对使用其农畜商品交易中心账号和密码、资金密码、手机验证码进行的任何操作和后果承担全部责任。当用户发现农畜商品交易中心账号、密码、或资金密码、验证码被未经其授权的第三方使用，或存在其他账号安全问题时，应立即有效通知农畜商品交易中心，要求农畜商品交易中心暂停该农畜商品交易中心账号的服务。农畜商品交易中心有权在合理时间内对用户的该等请求采取行动，但对农畜商品交易中心采取行动前用户已经遭受的损失不承担任何责任。用户在未经农畜商品交易中心同意的情况下不得将农畜商品交易中心账号以赠与、借用、租用、转让或其他方式处分给他人。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t3.2.3.用户应当遵守农畜商品交易中心不时发布和更新的用户协议以及其他服务条款和操作规则。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t四、交易规则\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t用户承诺在其进入农畜商品交易中心交易，通过农畜商品交易中心与其他用户进行交易的过程中良好遵守如下农畜商品交易中心交易规则。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t4.1.浏览交易信息\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t用户在农畜商品交易中心浏览交易信息时，应当仔细阅读交易信息中包含的全部内容，包括但不限于价格、委托量、手续费、买入或卖出方向，用户完全接受交易信息中包含的全部内容后方可点击按钮进行交易。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t4.2.提交委托\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t在浏览完交易信息确认无误之后用户可以提交交易委托。用户提交交易委托后，即用户授权农畜商品交易中心代理用户进行相应的交易撮合，农畜商品交易中心在有满足用户委托价格的交易时将会自动完成撮合交易而无需提前通知用户。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t4.3 查看交易明细\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t用户可以通过管理中心的交易明细中查看相应的成交记录，确认自己的详情交易记录。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t4.4 撤销/修改委托\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t在委托未达成交易之前，用户有权随时撤销或修改委托。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t五、用户的权利和义务\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t5.1用户有权按照本协议约定接受农畜商品交易中心提供的交易平台服务。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t5.2 用户有权随时终止使用农畜商品交易中心服务。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t5.3 用户有权随时提取在农畜商品交易中心的资金余额，包括人民币以及，但需向农畜商品交易中心支付相应的提现手续费用。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t5.4 用户对注册时提供的个人资料的真实性、有效性及安全性负责。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t5.5用户在农畜商品交易中心进行交易时不得恶意干扰交易的正常进行、破坏交易秩序。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t5.6用户不得以任何技术手段或其他方式干扰农畜商品交易中心的正常运行或干扰其他用户对农畜商品交易中心服务的使用。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t5.7如用户因网上交易与其他用户产生诉讼的，不得通过司法或行政以外的途径要求农畜商品交易中心提供相关资料。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t5.8 用户不得以虚构事实等方式恶意诋毁农畜商品交易中心的商誉。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t六、农畜商品交易中心的权利和义务\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t6.1如用户不具备本协议约定的注册资格，则农畜商品交易中心有权拒绝用户进行注册，对已注册的用户有权注销其农畜商品交易中心会员账号，农畜商品交易中心因此而遭受损失的有权向前述用户或其法定代理人主张赔偿。同时，农畜商品交易中心保留其他任何情况下决定是否接受用户注册的权利。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t6.2农畜商品交易中心发现账户使用者并非账户初始注册人时，有权中止该账户的使用。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t6.3农畜商品交易中心通过技术检测、人工抽检等检测方式合理怀疑用户提供的信息错误、不实、失效或不完整时，有权通知用户更正、更新信息或中止、终止为其提供农畜商品交易中心服务。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t6.4农畜商品交易中心有权在发现农畜商品交易中心上显示的任何信息存在明显错误时，对信息予以更正。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t6.5农畜商品交易中心保留随时修改、中止或终止农畜商品交易中心服务的权利，农畜商品交易中心行使修改或中止服务的权利不需事先告知用户，农畜商品交易中心终止农畜商品交易中心一项或多项服务的，终止自农畜商品交易中心在网站上发布终止公告之日生效。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t6.6农畜商品交易中心应当采取必要的技术手段和管理措施保障农畜商品交易中心的正常运行，并提供必要、可靠的交易环境和交易服务，维护交易秩序。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t6.7如用户连续一年未使用农畜商品交易中心会员账号和密码登录农畜商品交易中心，则农畜商品交易中心有权注销用户的农畜商品交易中心账号。账号注销后，农畜商品交易中心有权将相应的会员名开放给其他用户注册使用。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t6.8农畜商品交易中心通过加强技术投入、提升安全防范等措施保障用户的人民币资金及托管安全，有义务在用户资金出现可以预见的安全风险时提前通知用户。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t6.9农畜商品交易中心有权在本协议履行期间及本协议终止后保留用户的注册信息及用户应用农畜商品交易中心服务期间的全部交易信息，但不得非法使用该等信息。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t6.10.农畜商品交易中心有权随时删除农畜商品交易中心网站内各类不符合国家法律法规、规范性文件或农畜商品交易中心网站规定的用户评价等内容信息，农畜商品交易中心行使该等权利不需提前通知用户。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t七、特别声明\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t7.1 在法律允许的范围内，不论在何种情况下，农畜商品交易中心对由于信息网络设备维护、信息网络连接故障、电脑、通讯或其他系统的故障、电力故障、罢工、劳动争议、暴乱、起义、骚乱、生产力或生产资料不足、火灾、洪水、风暴、爆炸、战争、政府行为、司法行政机关的命令、其他不可抗力或第三方的不作为而造成的不能服务或延迟服务，以及用户因此而遭受的损失不承担责任。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t八、知识产权\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t8.1农畜商品交易中心所包含的全部智力成果包括但不限于网站标志、数据库、网站设计、文字和图表、软件、照片、录像、音乐、声音及其前述组合，软件编译、相关源代码和软件 (包括小应用程序和脚本) 的知识产权权利均归软件提供商所有。用户不得为商业目的复制、更改、拷贝、发送或使用前述任何材料或内容。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t8.2农畜商品交易中心名称中包含的所有权利 (包括但不限于商誉和商标、标志) 均归<span>华联全球商贸</span>所有。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t8.3用户接受本协议即视为用户主动将其在农畜商品交易中心发表的任何形式的信息的著作权，包括但不限于：复制权、发行权、出租权、展览权、表演权、放映权、广播权、信息网络传播权、摄制权、改编权、翻译权、汇编权以及应当由著作权人享有的其他可转让权利无偿独家转让给农畜商品交易中心所有，农畜商品交易中心有权利就任何主体侵权单独提起诉讼并获得全部赔偿。本协议属于《中华人民共和国著作权法》第二十五条规定的书面协议，其效力及于用户在农畜商品交易中心发布的任何受著作权法保护的作品内容，无论该内容形成于本协议签订前还是本协议签订后。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t8.4 用户在使用农畜商品交易中心服务过程中不得非法使用或处分农畜商品交易中心或他人的知识产权权利。用户不得将已发表于农畜商品交易中心的信息以任何形式发布或授权其它网站（及媒体）使用。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t九、客户服务\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t农畜商品交易中心建立专业的客服团队，并建立完善的客户服务制度，从技术、人员和制度上保障用户提问及投诉渠道的畅通，为用户提供及时的疑难解答与投诉反馈。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t十、协议的变更和终止\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t10.1.协议的变更：农畜商品交易中心有权随时对本协议内容或农畜商品交易中心发布的其他服务条款及操作规则的内容进行变更，变更时农畜商品交易中心将在农畜商品交易中心站内显著位置发布公告，变更自公告发布之时生效，如用户继续使用农畜商品交易中心提供的服务即视为用户同意该等内容变更，如用户不同意变更后的内容则用户有权注销农畜商品交易中心账户、停止使用农畜商品交易中心服务。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t10.2.协议的终止\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t10.2.1.农畜商品交易中心有权依据本协议约定注销用户的农畜商品交易中心账号，本协议于账号注销之日终止。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t10.2.2.农畜商品交易中心有权依据本协议约定终止全部农畜商品交易中心服务，本协议于农畜商品交易中心全部服务终止之日终止。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t10.2.3.本协议终止后，用户无权要求农畜商品交易中心继续向其提供任何服务或履行任何其他义务，包括但不限于要求农畜商品交易中心为用户保留或向用户披露其原农畜商品交易中心账号中的任何信息，向用户或第三方转发任何其未曾阅读或发送过的信息等。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t10.2.4.本协议的终止不影响守约方向违约方追究违约责任。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t十一、隐私权政策\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t11.1.适用范围\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t11.1.1.在用户注册农畜商品交易中心账号或者支付账户时，用户根据农畜商品交易中心要求提供的个人注册信息，包括但不限于身份证信息；\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t11.1.2.在用户使用农畜商品交易中心服务时，或访问农畜商品交易中心网页时，农畜商品交易中心自动接收并记录的用户浏览器上的服务器数值，包括但不限于IP地址等数据及用户要求取用的网页记录；\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t11.1.3.农畜商品交易中心收集到的用户在或许币网进行交易的有关数据，包括但不限于出价、购买等记录；\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t11.1.4.农畜商品交易中心通过合法途径取得的其他用户个人信息。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t11.2.信息使用\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t11.2.1.农畜商品交易中心不会向任何人出售或出借用户的个人信息，除非事先得到用户的许可。农畜商品交易中心也不允许任何第三方以任何手段收集、编辑、出售或者无偿传播用户的个人信息。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t11.3.农畜商品交易中心对所获得的客户身份资料和交易信息进行保密，不得向任何单位和个人提供客户身份资料和交易信息，法律法规另有规定的除外。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t十二、反洗钱\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t12.1农畜商品交易中心遵守和执行《中华人民共和国反洗钱法》的规定，对用户进行身份识别、客户身份资料和交易记录保存制度，以及大额的和可疑交易报告的制度。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t12.2用户注册、挂失交易密码或者资金密码时，应当提供并上传身份证复印件，农畜商品交易中心对用户提供的身份证信息进行识别和比对。农畜商品交易中心有合理的理由怀疑用户使用虚假身份注册时，有权拒绝注册或者注销已经注册的账户。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t12.3农畜商品交易中心参照《金融机构大额交易和可疑交易报告管理办法》的规定，保存大额交易和有洗钱嫌疑的交易记录，在监管机构要求提供大额交易和可疑交易的记录时，向监管机构提供。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t12.4农畜商品交易中心对用户身份信息以及大额交易、可疑交易记录进行保存，依法协助、配合司法机关和行政执法机关打击洗钱活动，依照法律法规的规定协助司法机关、海关、税务等部门查询、冻结和扣划客户存款。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t十三、风险提示\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t13.1交易有极高的风险。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t13.1.1市场是全新的、未经确认的，而且可能不会增长。目前，主要由投机者大量使用，零售和商业市场使用相对较少，因此价格易产生波动，并进而对投资产生不利影响。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t13.1.2市场没有像中国股市那样的涨跌停限制，同时交易是24小时开放的。由于筹码较少，价格易受到庄家控制，有可能出现一天价格涨几倍的情况，同时也可能出现一天内价格跌去一半的情况。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t13.2参与交易，用户应当自行控制风险，评估投资价值和投资风险，承担损失全部投资的经济风险。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t13.3因国家法律、法规和规范性文件的制定或者修改，导致的交易被暂停、或者禁止的，因此造成的经济损失全部由用户自行承担。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t十四、违约责任\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t14.1农畜商品交易中心或用户违反本协议的约定即构成违约，违约方应当向守约方承担违约责任。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t14.2如因用户提供的信息不真实、不完整或不准确给农畜商品交易中心造成损失的，农畜商品交易中心有权要求用户对农畜商品交易中心进行损失的赔偿。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t14.3如因用户违反法律法规规定或本协议约定，在农畜商品交易中心或利用农畜商品交易中心服务从事非法活动的，农畜商品交易中心有权立即终止继续对其提供农畜商品交易中心服务，注销其账号，并要求其赔偿由此给农畜商品交易中心造成的损失。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t14.4如用户以技术手段干扰农畜商品交易中心的运行或干扰其他用户对农畜商品交易中心使用的，农畜商品交易中心有权立即注销其农畜商品交易中心账号，并有权要求其赔偿由此给农畜商品交易中心造成的损失。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t14.5如用户以虚构事实等方式恶意诋毁农畜商品交易中心的商誉，农畜商品交易中心有权要求用户向农畜商品交易中心公开道歉，赔偿其给农畜商品交易中心造成的损失，并有权终止对其提供农畜商品交易中心服务。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t十五、争议解决\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t15.1用户与农畜商品交易中心因本协议的履行发生争议的应通过友好协商解决，协商解决不成的，任一方有权将争议提交南京市仲裁委员会依据该会仲裁规则进行仲裁。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t十六、生效和解释\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t16.1本协议于用户点击农畜商品交易中心注册页面的同意注册并完成注册程序、获得农畜商品交易中心账号和密码时生效，对农畜商品交易中心和用户均具有约束力。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\">\r\n\t16.2本协议的最终解释权归农畜商品交易中心所有。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n\t<span>&nbsp;</span> \r\n</p>\r\n<p>\r\n\t<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"margin-left:72pt;\">\r