  `brief` varchar(255) DEFAULT NULL COMMENT '币种简称',
  `name` varchar(255) DEFAULT NULL COMMENT '币种名称',
  `enname` varchar(255) DEFAULT NULL COMMENT '英文名',
  `imgurl` varchar(255) DEFAULT NULL COMMENT '图标路径',
  `text` varchar(255) DEFAULT NULL COMMENT '币种介绍',
  `author` varchar(255) DEFAULT NULL COMMENT '研发者',
  `algorithm` varchar(255) DEFAULT NULL COMMENT '核心算法',
  `createtime` varchar(255) DEFAULT NULL COMMENT '推出时间',
  `releasedate` varchar(255) DEFAULT NULL COMMENT '发布时间',
  `blocktime` varchar(255) DEFAULT NULL COMMENT '区块时间',
  `blockreward` varchar(255) DEFAULT NULL COMMENT '区块奖励',
  `totalmoney` int(11) DEFAULT NULL COMMENT '货币总量',
  `advantage` varchar(255) DEFAULT NULL COMMENT '主要特色',
  `disadvantage` varchar(255) DEFAULT NULL COMMENT '不足之处',
  `ip` varchar(255) DEFAULT NULL COMMENT '服务器ip',
  `port` varchar(255) DEFAULT NULL COMMENT '钱包服务器端口',
  `password` varchar(255) DEFAULT NULL COMMENT '钱包服务器密码',
  `address` varchar(255) DEFAULT NULL COMMENT '钱包地址',
  `selltop` int(11) DEFAULT '5000' COMMENT '卖出上限',
  `buytop` int(11) DEFAULT '5000' COMMENT '买出上限',
  `riserange` int(11) DEFAULT NULL COMMENT '涨停幅度',
  `fallrange` float(11,2) DEFAULT NULL COMMENT '跌停幅度',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '是否启用1启用2禁用',
  `changestatus` int(11) NOT NULL DEFAULT '1' COMMENT '转入状态1启用2禁用',
  `poundage` float(11,2) DEFAULT NULL COMMENT '转出手续费',
  `minnumber` int(11) DEFAULT NULL COMMENT '单笔最小转出数量',
  `maxnumber` int(11) DEFAULT NULL COMMENT '单笔最大转出数量',
  `voluntarily` varchar(255) DEFAULT NULL COMMENT '转出自动（小于等于该数目的金额无需人工审核）',
  `market` int(11) DEFAULT NULL COMMENT '市场',
  `buycomplicated` varchar(255) DEFAULT NULL COMMENT '用于处理购买并发的文件路径',
  `scale` int(11) DEFAULT NULL COMMENT '挂单比例',
  `sellcomplicated` varchar(255) DEFAULT NULL COMMENT '用于处理卖出并发的文件',
  `buypoundage` float(11,6) NOT NULL DEFAULT '0.000000' COMMENT '买家手续费',
  `sellpoundage` float(11,6) NOT NULL DEFAULT '0.000000' COMMENT '卖家手续费',
  `inminnumber` int(11) DEFAULT '0' COMMENT '转入虚拟币最小数量',
  `inmaxnumber` int(11) DEFAULT '0' COMMENT '转入虚拟币最大数量',
  `totalmaxnumber` int(11) DEFAULT '0' COMMENT '今日转出最大数',
  `number_type` int(1) DEFAULT '1' COMMENT '默认2 1是数字资产 2 不是数字资产',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=85 DEFAULT CHARSET=utf8 COMMENT='网站虚拟币';

