INSERT INTO `currency_xnb` VALUES (1,'2','cny','人民币','1','Uploads/2017-08-02/598131b2e3b63.png','币种介绍','1','1','2017-07-13','2017-07-19','1','1',1,'1','1','钱包服务器ip是','币种简称','币种简称','77+9be+/vQ==',100000,100000,0,1.00,1,1,1.00,10,20,'0',34,'./Public/trade/27fb52568f337e96adf0924477b31aec.text',1,NULL,0.000000,0.000000,0,0,0,1),(62,'1','CMC','CMC','CMC','Uploads/2017-08-23/599cf5bc3a90a.png','CMC','CMC','OpenCoin原创算法','2011-04-18','2017-08-23','秒到','暂无',0,'Google旗下投资，去中心化交易功能已经实现，实际应用前景好','技术有待完善，XRP分发有待出方案',NULL,NULL,NULL,'77+9be+/vQ==',5000,5000,200,200.00,1,1,1.00,10,20,NULL,NULL,'./Public/trade/596b1ace5d2fb1eb200d4d52962b334f.text',100,'./Public/trade/68903f8d4737788e61a1697aedc2e446.text',1.000000,1.000000,1,10000,0,1),(81,'1','SunitEwes','苏尼特羊','SunitEwes','Uploads/2017-11-18/5a0fd98e582e2.jpg','苏尼特羊也称戈壁羊，属蒙古绵羊系统中的一类群，在苏尼特草原特定生态环境中经过长期的自然选择和人工选择而形成，形成的历史悠久。在放牧条件下，成为具有耐寒，抗旱，生长发育快，生命力强，最能适应荒漠半荒漠草原的一个肉用地方良种。1986年被锡林郭勒盟技术监督局批准为地方良种，1997年内蒙古自治区人民政府正式命名。','0','0','2016-05-16','2016-05-16','0','暂无',0,'0','0',NULL,NULL,NULL,'5pqC5peg',5000,5000,200,200.00,1,1,1.00,1,1000,NULL,NULL,'./Public/trade/b5e5ddd1d920d15468a4983f7487468a.text',100,'./Public/trade/1c0a184320b5d7b532a707b0c788404a.text',1.000000,1.000000,1,10000,20000,2),(82,'1','Hulunbeier','呼伦贝尔细毛羊','Hulunbeier','Uploads/2017-11-15/5a0bbd90b33ce.jpg','0','0','0','2014-07-19','2014-07-19','0','暂无',0,'0','暂无',NULL,NULL,NULL,'5pqC5peg',5000,5000,200,200.00,1,1,1.00,1,10000,NULL,NULL,'./Public/trade/64cc77b6b5b66f428820b12632e98e51.text',100,'./Public/trade/ee98f211bdbde8cd7f6c0060a05ee84e.text',1.000000,1.000000,1,100000,1,2),(83,'1','Ujimqin','乌珠穆沁羊','Ujimqin','Uploads/2017-11-15/5a0bbb29b8200.jpg','乌珠穆沁羊产于内蒙古锡林郭勒盟东部乌珠穆沁草原，主要分布在东乌珠穆沁旗，西乌珠穆沁旗等地区，产量总数已超过100万只。乌珠穆沁羊系蒙古羊在当地条件下，经过长期选育形成的一个优良类群，1982年经国家农业部，国家标准总局的确认下，正式批准乌珠穆沁羊为当地优良品种。','0','0','2014-04-26','2014-04-26','0','0',0,'0','0',NULL,NULL,NULL,'5pqC5peg',5000,5000,200,0.00,1,1,1.00,0,10000,NULL,NULL,'./Public/trade/22517362499599a28226307cae40e0ab.text',100,'./Public/trade/488089fa127ca3b7f194334849ef6d43.text',1.000000,1.000000,0,10000,100000000,2),(84,'1','Merino','美利奴羊','Merino','Uploads/2017-11-15/5a0bb4aedc321.jpg','从悉尼驱车南行，快到澳大利亚的“粮仓”墨尔本时，发现一头巨大无比的绵羊憨态可掬地站在路旁。走近一看，这“羊”足有三层楼高。我情不自禁地停下车来，在“羊”前留影，并好奇地走进“羊”肚。原来这是一家出售旅游纪念品的免税商店，商品多与羊有关。登楼临窗，远眺一望无际的牧场，蓝天白云，绿草羊群，令人陶醉。下来一看，那两扇窗户竟是那巨“羊”的眼睛。','0','0','2016-07-18','2016-07-18','0','0',0,'0','暂无',NULL,NULL,NULL,'5pqC5peg',5000,5000,200,200.00,1,1,1.00,0,1000,NULL,NULL,'./Public/trade/b568553a64739db0a1a63c306d9550ce.text',100,'./Public/trade/abedc212ea1237249fa9f8f2b6c66355.text',1.000000,1.000000,0,1000,2000000,2);
